script: |
  super -f text -I q8550.spq | sort > q8550.out

inputs:
  - name: q8550.spq
    data: |
      SELECT ALL col2 FROM tab2 (FORMAT parquet) WHERE NOT - + col2 * - col0 + - col1 * - 68 <= - col0 + + 96 - + col1 / col2;
  - name: tab2

outputs:
  - name: q8550.out
    data: |
      23
      40
      58
